import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Home from './pages/Home';
import SaibaMais from './pages/SaibaMais';

import {FaPiggyBank, FaTree} from 'react-icons/fa';
import {GrDiamond} from 'react-icons/gr';
import {BiWorld, BiBlock} from 'react-icons/bi';
import {ImHammer2} from 'react-icons/im';
import {AiFillBank} from 'react-icons/ai';
import {RiGlobalLine} from 'react-icons/ri';

function Routes() {

    const Date = [
        {
            Titulo: 'Todos',
            Icone: <RiGlobalLine/>,
            Texto: '',
            preco: ''

        },
        {
            Titulo: 'Profissional',
            Icone: '',
            Texto: '',
            preco: 29.99

        },
        {
            Titulo: 'Reguladores',
            Icone: <AiFillBank/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Sócio Ambiental',
            Icone: <FaTree/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Jurídico',
            Icone: <ImHammer2/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Listas Restritivas',
            Icone: <BiBlock/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Mídia / Internet',
            Icone: <BiWorld/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Bens e Imóveis',
            Icone: <GrDiamond/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Cadastro',
            Icone: '',
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Financeiro',
            Icone: <FaPiggyBank/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Financeiro',
            Icone: <FaPiggyBank/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Sócio Ambiental',
            Icone: <FaTree/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Jurídico',
            Icone: <ImHammer2/>,
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
    ]


    return (
        <BrowserRouter>
            <Switch>
                <Route path="/" component={Home} exact />
                <Route path="/Saiba-mais" component={SaibaMais} />
            </Switch>
        </BrowserRouter>
    )
}

export default Routes;
